eko.getDetailLinks=async function(e){let t=await eko.waitForElementPresent(document.body,"#search",5e3);t||(t=document.body);let n=[],o=t.querySelectorAll("a:has(h3)");for(let e=0;e<o.length;e++){let t=o[e].querySelector("h3"),l=eko.cleanText(t),r=o[e].getAttribute("href");n.push({title:l,url:r})}return{links:n}},eko.getContent=async function(e){return await eko.waitLoaded(),{title:document.title,content:eko.extractHtmlContent()}};